The Bucket list / Nez si pro nas prijde (2007)

Dva pratele, oba ve stadiu nevylecitelne rakoviny, se rozhodnou utect z nemocnicniho oddeleni a vydavaji se na spolecnou cestu se seznamem veci, ktere by radi udelali pred svou smrti. Jack Nicholson si kvuli sve roli oholil hlavu. Termin americke premiery je stanoven na 11. ledna 2008. Pribeh je velmi podobny nemeckemu filmu z roku 1997 Klepani na nebeskou branu.

